import './App.css';

import Header from './components/header';
import AddTimeTable from './components/AddTimeTable';

import {BrowserRouter as Router,Route} from "react-router-dom"



function App() {


  return (

    <div>
    <Routes>
      <Header/>
      <Route path="/create" element={AddTimeTable} ></Route>

    </Routes>
  </div>      

  );
}


export default App;
